import React from "react";
import {
  Box,
  Button,
  Checkbox,
  FormControl,
  FormControlLabel,
  FormGroup,
  FormLabel,
  Grid,
  TextField,
} from "@material-ui/core";
import FormikControl from "../../../hooks/FormikControl";
function OfferCheckbox() {
  return (
      <Box className={classes.inputBoxChechk}>
        <FormikControl
          control="checkbox"
          label="Type de l'enseigne"
          name="TypeLenseigne"
          options={TypeLenseigne}
          field={formik.values}
        />

        <Box>
          <FormikControl
            control="checkbox"
            label="Type de l'enseigne"
            name="TypeLenseigne"
            options={TypeLenseigne}
            field={formik.values}
          />

          <FormControl style={{ width: "15vw", marginTop: 10 }}>
            <Box style={{ display: "flex", alignItems: "center" }}>
              <FormLabel
                component="legend"
                style={{ fontWeight: "800", color: "#000" }}
              >
                Label SMR
              </FormLabel>
              <img src={Question} style={{ width: 35, height: 30 }} />
            </Box>

            <FormControlLabel
              style={{ marginTop: 10 }}
              control={
                <Checkbox
                  //   checked={estAlim}
                  //   onChange={(e) => setEstAlim(e.target.checked)}
                  name="souscrire"
                  color="default"
                />
              }
              label="Je souhaite souscrire au label Sain,Main,Responsable"
            />
          </FormControl>
        </Box>
      </Box>
  );
}

export default OfferCheckbox;
